import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
            <h3> Car Check </h3>
            <ul className="nav-Links">
                <Link>
                <li> About </li>
                </Link>
                <li> Sign Up </li>
                <li> Sign In </li> 
            </ul>
        </nav>
    );
}

export default Nav;
